import React from 'react';

class Introduction extends React.Component{

        render(){

            return (
            <h1>Esta prueba se llevará a cabo para demostrar conocimientos generales,
            que se basa en una serie de preguntas con múltiples respuestas.</h1>

            );
        }
}

export default Introduction;
